import { useEffect, useState } from "react";


let AmbulanceProfilePg1 = () => {

    
    let alid=JSON.parse(localStorage.getItem("loginInfo")).lid.lid;
    const[ambulance,setAmbulance]=useState([]);

    useEffect( ()=>{

                fetch("http://localhost:8080/login"+alid)
                .then(resp=>resp.json())
                .then(data=>setAmbulance(data))
    } )

    return(


        <div>
        <h2>hiiiii {alid} </h2>


        </div>
    )




}
export default AmbulanceProfilePg1;
